export const shyBlue = "#dfe8eb";
export const lightBlue = "#e8faff";
export const darkText = "#292f33";
export const darkBlueText = "#3c5157";
export const shyRed = "#ff4a3d";
export const bgLightBlue = "#def3fa";
export const bgfadeBlue = "#c7ddff";
export const bgDarkBlue = "#536b91";
export const bgGrayBlue = "#b4bec2";
export const bgSlateBlue = "#233036";
export const bgApp = "#becacf";

export const bgShyBlue = "linear-gradient(to right bottom, #e4edf0, #dfe8eb)";
export const elmShyBlue = "linear-gradient(to right bottom, #dfe8eb, #e4edf0)";
export const elmLightBlue =
  "linear-gradient(to right bottom, #e8faff, #cff4ff)";
export const inputShyBlue =
  "linear-gradient(to right bottom, rgba(201, 209, 212, 0.2), rgba(242, 248, 250, 0.6))";

export const taskBlack =
  "linear-gradient(to right bottom, #233036, #1e2a2f, #1a2328, #151d21, #10171a)";
export const taskBlue =
  "linear-gradient(to right top, #15253d, #122745, #10294e, #0d2a56, #0b2c5e)";
export const taskTurquoise =
  "linear-gradient(to right top, #126d6d, #0f5b5b, #0b4a4a, #083939, #052929)";
export const taskGreen =
  "linear-gradient(to right top, #053728, #054532, #05543c, #056347, #067351)";
export const taskPink =
  "linear-gradient(to right top, #7a006f, #850279, #900583, #9b098e, #a60d98)";

export const gradientBlue =
  "linear-gradient(to bottom, #def3fa, #dbeff7, #d8ecf3, #d6e8f0, #d3e5ec, #d0e4eb, #cce2ea, #c9e1e9, #c4e1eb, #bfe0ec, #bbe0ee, #b6dff0)";

export const gradientGreen =
  "linear-gradient(to bottom, #def3fa, #daf1f6, #d6eff1, #d3eceb, #d1eae6, #cceae3, #c8eade, #c5ead9, #bfecd3, #baeecc, #b7efc4, #b6f0bb)";

export const gradientRed =
  "linear-gradient(to bottom, #def3fa, #dcedf9, #dde6f7, #dfdff2, #e3d8ea, #e5d3e6, #e7cee1, #e9c9da, #ebc4d9, #edc0d7, #eebbd6, #f0b6d4)";
export const gradientCyan =
  "linear-gradient(to bottom, #dfe8eb, #dfeaee, #dfecf0, #deeef3, #def0f6, #d3edf6, #c8ebf6, #bce8f6, #a0dff3, #81d7f0, #5bceee, #12c5eb)";

export const inputShadows = `
inset 2px 2px 6px rgba(54, 73, 79, 0.25),
    inset -2px -2px 8px rgba(242, 248, 250, 0.9);
`;
